import React from "react";

import { connect } from "react-redux";

import { createStructuredSelector } from "reselect";

import { selectRentalsForPreview } from "../../redux/rental/rental.selectors";

// import "./rental-category.scss";

import RentalItem from "../rental-item/rental-item.component";

const RentalCategory = ({ rentals }) => (
  <div className="category">
    {rentals.map(({ id, categoryName, products }) => (
      <RentalCategory2 key={id} products={products}>
        {categoryName}
      </RentalCategory2>
    ))}
  </div>
);

const mapStateToProps = createStructuredSelector({
  rentals: selectRentalsForPreview,
});

export default connect(mapStateToProps)(RentalCategory);
